import React from "react";
import Logo from "../components/Logo";
//Appel la Navigation pour faire fonctionner la navigation
import Navigation from "../components/Navigation";
import "bootstrap/dist/css/bootstrap.css";

const Présentation = () => {
  return (
    <div>
      <Logo />
      <Navigation />
      <div className="saut"></div>
      <div className="centrer">
        <div className="container">
          <div className="row">SpaceShop</div>
          <div className="row">
            <div className="col">
              This is a space related shop for space exploration and observation
              scaled models
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Présentation;
